import React, { Component } from "react";
import Button from "@material-ui/core/Button";
const allfun = () => {
  alert("booogh");
  console.log("dddd");
};
class App extends Component {
  render() {
    return (
      <Button variant="contained" color="primary" onClick="this.allfun()">
        hello world
      </Button>
    );
  }
}

export default App;
